import React, { Component } from "react";
import "./App.css";
import HeroList from "./components/heroList";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <div class="wrapper">
          <div className="header p-3 mb-2 bg-dark">
            <h1 className="text-center text-light">HOTS Bravery</h1>
          </div>

          <div className="container p-3 mb-2">
            <div className="row">
              <img
                src="https://static.heroesofthestorm.com/gd/3a87a62680f43b26f7dd3d203b77e8cd/heroes/abathur/circleIcon.png"
                className="justify-content-center bg-dark"
              />
            </div>
            <h1 className="text-center">Abathur</h1>
          </div>
          <div className="container">
            <HeroList />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default App;
